export function restaurantImage(id:number):string{
    switch(id){
        case 1:
            return(restaurant1());
        case 2:
            return(restaurant2());
        case 3:
            return(restaurant3());
        case 4:
            return(restaurant4());
        case 5:
            return(restaurant5());
        case 6:
            return(restaurant6());

        default:
            return(loginBackground())
        break;


    }
}

export function userImage(id:number):string{
    switch(id){
        case 1:
            return(user1());
        case 2:
            return(user2());
        case 3:
            return(user3());

        default:
            return(loginBackground())
        break;


    }
}


